(6, 4, 'SANA BIN YOUSUF', '20230626072851_images.png', '<h1 style=\"padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(221, 221, 221); border-left-color: initial; border-image: initial; outline: 0px; vertical-align: baseline; line-height: 1.45; text-rendering: optimizelegibility; font-family: Georgia, \"Times New Roman\", Times, serif; font-size: 32px; margin: 16px 0px; position: relative; color: rgb(31, 31, 29); background-color: rgb(255, 255, 255);\">Titanic Articles & Newspapers</h1><section style=\"margin: 0px; padding-top: 0px; padding-bottom: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(31, 31, 29); font-family: Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">The Titanic is historically remembered for being the unsinkable ship that sank on her maiden voyage in April 1912. Titanic records mostly consist of plans for the ship, information on how the ship was built, as well as passenger manifests, which are deemed incomplete. Other Titanic records are largely made up from eyewitness accounts and stories and journals passed down in families whose ancestors were part of the Titanic voyage.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">Titanic records prove that the ship was the largest one ever made back in 1912. Titanic records also show that the ship cost $7.5 million to construct and was made by Harland and Wolff in Belfast, Ireland. Over 14,000 men helped build this epic ship over three years, and the Titanic was advertised to be the most luxurious and safest floating 5 star hotel, sporting the first swimming pool on a cruise ship.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">Titanic records show the ship sailed safely from Belfast to Southampton, England, where it was docked until its maiden voyage was set for April 10, 1912. After only four days at sea, the Titanic hit an iceberg and sank on April 15.</p><h2 style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 1.45; text-rendering: optimizelegibility; font-family: Georgia, \"Times New Roman\", Times, serif; font-size: 20px; margin: 20px 0px 10px;\">Titanic Timeline</h2><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\"><span style=\"font-weight: 700;\">April 2-3, 1912:</span> The Titanic sailed from Belfast, Ireland to Southampton, England in preparation for its maiden voyage across the Atlantic.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\"><span style=\"font-weight: 700;\">April 14, 1912; 11:40 pm:</span> Quartermaster Robert Hitchens was steering the ship when the Titanic hit an iceberg. Prior to this, the Titanic had received multiple warnings regarding sightings of icebergs, but remained full steam ahead.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\"><span style=\"font-weight: 700;\">April 15, 1912; 12:00-12:25 am:</span> Captain Smith is notified that all six watertight compartments are damaged, and the Titanic will sink in two hours. By 12:25 am, Captain Smith orders crew to start filling lifeboats with women and children.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\"><span style=\"font-weight: 700;\">April 15, 1912; 12:45-2:17 am:</span> Lifeboats are launched during this period as the Titanic continues to send out distress signals.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\"><span style=\"font-weight: 700;\">April 15, 1912; 2:20 am:</span> The Titanic breaks into two pieces and sinks below the ocean\'s surface, taking many passengers with it.</p><h3 style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 1.45; text-rendering: optimizelegibility; font-family: Georgia, \"Times New Roman\", Times, serif; font-size: 24px; margin: 24px 0px 12px;\">Titanic Newspaper Articles</h3><span style=\"font-weight: 700;\">Daily Review</span><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">The Daily Review, published in Decatur, Illinois on April 15, 1912, unfortunately carried the important story of the sinking of the Titanic. This Titanic newspaper account revealed that aboard the ship\'s maiden voyage from England bound for New York were Mr. and Mrs. John Jacob Astor, Mr. and Mrs. Vanderbilt, Major Archibald Butt, journalist William Thomas Stead and Benjamin Guggenheim.</p><img alt=\"titanic newspaper articles\" src=\"https://www.archives.com/genealogy/images/titanic_dailyreview.png\" class=\"mt-image-right\" height=\"633\" width=\"471\" style=\"margin: 0pt 0pt 20px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; float: right;\"><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">The main headline surrounding the sinking of the ship in this Titanic newspaper was the fact that wireless telegraphy had not failed, but prevailed since surrounding ocean liners were able to hear the Titanic\'s distress calls. Unfortunately, these liners weren\'t in a position to respond quickly enough to rescue the large amounts of lower class passengers and crew members that went down with the Titanic due to a shortage of lifeboats.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">This Titanic newspaper account also described the basic, well-known facts of the time surrounding the Titanic, including that it was the biggest boat in the world. Also noted was the fact that an unusual amount of icebergs were reported in the area by other ships. Also written up was the fact that a special train designated for transporting Titanic survivors was being organized with the New Haven Railroad. Many of these survivors were taken to Halifax and would catch this train there.</p><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">This Titanic newspaper also displayed a photo of the Titanic prior to its fateful journey to the bottom of the ocean, but the majority of the front page is taken up with other news, both local and national, including the skirmishes that were taking place between the Republicans and Democrats.</p><span style=\"font-weight: 700;\">Trenton Evening Times</span><p style=\"padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; margin-right: 0px; margin-bottom: 16px; margin-left: 0px;\">The Trenton Evening Times published its Titanic newspaper articles on April 15, 1912, after learning initial facts from the tragic sinking. The main Titanic newspaper article described that the Titanic was due in New York the next day and was on course a day ahead of schedule, indicating high speeds, before it struck an iceberg. Also described was the general specs of that enormous ship, which was the largest ship ever built in 1912.</p></section>', '20230626073639_GAME UI.pdf', '4', '2023-06-23 11:23:36', '2023-06-23 16:53:36', 0, 1, 0, '4', '');

