(15, '20230615093217Asset_11-removebg-preview.png', 'Intencode Premium Membership', 'Technology', '2023-06-16', '2023-06-25', '<p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 1.5rem; display: inline; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">Have you ever thought about what Cyclone Biparjoy looks like from space? Well, NASA has the answer to this in the form of a satellite picture that appears just as scary as it does on Earth. The Visible Infrared Imaging Radiometer Suite (VIIRS) on the NOAA-20 satellite acquired a natural-colour image of the storm on June 14, a day before it was forecast to make landfall.&nbsp;</p><p style=\"-webkit-tap-highlight-color: transparent; margin-top: 1.5rem; margin-bottom: 1.5rem; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">According to a release by&nbsp;<a href=\"https://earthobservatory.nasa.gov/images/151463/cyclone-biparjoy-churns-toward-india-and-pakistan\" style=\"-webkit-tap-highlight-color: transparent; color: var(--clr-lnk); cursor: pointer; text-decoration: none; transition: all 200ms linear 0ms;\"><em style=\"-webkit-tap-highlight-color: transparent;\">NASA</em></a>, the long-lived cyclone had wind speeds of 129 kilometres per hour on June 14, making it a category 1 storm on the Saffir-Simpson Wind Scale.&nbsp;</p><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 1.5rem; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">Some 74,000 people have been shifted to shelters from Gujarat\'s coastal region ahead of cyclone Biparjoy\'s expected landfall in the Kutch district this evening.</p><div id=\"v-ndtv\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px; width: 650px;\"><div id=\"_vdo_ads_player_ai_5333\" style=\"-webkit-tap-highlight-color: transparent;\"></div></div><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 1.5rem; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">Biparjoy developed into a cyclone in the early morning hours of June 6. According to Roxy Mathew Koll, a climate scientist at the Indian Institute of Tropical Meteorology, sea surface temperatures in the Arabian Sea were 31°C to 32°C in early June, which was 2°C to 4°C above the climatological mean. A rule of thumb among scientists is that ocean temperatures should be above 27°C to sustain a tropical cyclone.</p><div style=\"-webkit-tap-highlight-color: transparent; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px; clear: both;\"></div><div id=\"jiosaavn-widget\" style=\"-webkit-tap-highlight-color: transparent; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px; margin-bottom: 20px;\"><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 1.5rem;\"></p><div style=\"-webkit-tap-highlight-color: transparent; position: fixed; top: 937px;\">Listen to the&nbsp;<a href=\"https://www.jiosaavn.com/featured/new-music-this-week/Ns2UZo9qDvI\" target=\"_blank\" style=\"-webkit-tap-highlight-color: transparent; color: var(--clr-lnk); cursor: pointer; text-decoration: none; transition: all 200ms linear 0ms;\">latest songs, only on&nbsp;</a><a href=\"https://www.jiosaavn.com/\" target=\"_blank\" style=\"-webkit-tap-highlight-color: transparent; color: var(--clr-lnk); cursor: pointer; text-decoration: none; transition: all 200ms linear 0ms;\">JioSaavn.com</a></div><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px;\"></p></div><div style=\"-webkit-tap-highlight-color: transparent; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px; clear: both;\"></div><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 1.5rem; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">According to India\'s Meteorological Department, Biparjoy may become the longest-lived cyclone in the Arabian Sea, overtaking Kyarr in 2019, which lasted nine days and 15 hours. As of June 14, the Arabian Sea sustained Biparjoy for over eight days.</p><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\"><span class=\"cmt_btnOut\" style=\"-webkit-tap-highlight-color: transparent; float: right; width: 110px; height: 100px; shape-outside: border-box; margin-left: 10px; margin-top: 79px;\"><span class=\"cmt_btn\" style=\"-webkit-tap-highlight-color: transparent; display: block; float: right; margin-bottom: 30px; margin-left: 20px; position: relative; text-align: center;\"><a class=\"btn_bm cmt-ac cmt-dn\" style=\"-webkit-tap-highlight-color: transparent; color: var(--ttl); cursor: pointer; text-decoration: none; transition: all 200ms linear 0ms; font-family: var(--ff-one); font-size: 14px; display: flex; width: 100px; padding: 0px 10px 2px; position: relative; background: rgb(247, 247, 247); height: 70px; flex-flow: column wrap; justify-content: center; line-height: 0; border-radius: 4px; font-weight: bold;\"><span class=\"ndtv-cmnt-txt\" style=\"-webkit-tap-highlight-color: transparent; display: block; margin-bottom: 0px; font-size: 15px; font-weight: 400; line-height: normal;\">Post a comment</span></a></span></span>With cyclone Biparjoy less than 200 km from the coast of Gujarat, Kachchh\'s Mandvi is witnessing rough sea conditions and strong winds. Classified as a \"very severe cyclonic storm\" of category 3, Biparjoy is expected to cross Saurashtra and Kutch and adjoining Pakistan coasts between Mandvi and Karachi near Jakhau Port between 4-8 PM, according to the India Meteorological Department (IMD).&nbsp;</p><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\"><br></p><p style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\"><br></p><ul><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">sdsfs</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">fsdfsdf</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">sf</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">sd</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">fsd</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">fs</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">df</li><li style=\"-webkit-tap-highlight-color: transparent; margin-bottom: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">dsfsdfsdfsd</li></ul>', 'EASN123', '2023-06-15 04:02:17', '2023-06-15 04:02:17'),
